import React from "react"
import style from "./MyPosts.module.css"
import Post from "./Post/Post";
import NewPost from "./NewPost/NewPost";
import Preloader from "../../common/Preloader/Preloader";

const MyPosts = (props) => {
    let postsElement = () => { if (!props.profilePage.profile){
        props.profilePage.posts.map(p => <Preloader/>)
    } 
        props.profilePage.posts.map(p => <Post
            lickCount={p.lickCount} text={p.text} key={p.id} avatar={p.profile.photos.small}/>)
    }
    return (
    <div className={style.posts}>
<div>  </div>
    <div>
         <div className={style.info}>
            <h2>Posts</h2>
            <NewPost onAddPost={props.onAddPost} onTextChange={props.onTextChange} state={props.profilePage}/>
        </div>
        <div className={style.posts}>
            {postsElement}
        </div>
    </div>
    </div>
)
}

export default MyPosts
